    "def Roulette_wheel_selection(fitness_score):\n",
    "    Pc = [] #probability of selecting a chromosome\n",
    "    sum_of_fitness = np.sum(fitness_score)\n",
    "    for i in fitness_score:\n",
    "        Pc.append(i/sum_of_fitness)\n",
    "#     print(Pc)\n",
    "    # print(\"Pc\",Pc)\n",
    "    return Pc"
