    "import requests\n",
    "\n",
    "# Function to get directions from Google Maps Directions API\n",
    "def get_directions_api_route(origin, destination, api_key):\n",
    "    url = \"https://maps.googleapis.com/maps/api/directions/json\"\n",
    "    params = {\n",
    "        'origin': origin,\n",
    "        'destination': destination,\n",
    "        'key': api_key,\n",
    "        'alternatives': 'true',  # Request multiple routes\n",
    "        'waypoints': 'optimize:true|' + '|'.join(waypoints)  # Automatically optimize waypoints\n",
    "    }\n",
    "    response = requests.get(url, params=params)\n",
    "    directions = response.json()\n",
    "    return directions['routes']\n",
    "\n",
    "# Function to find the shortest route based on distance\n",
    "def find_shortest_route(routes):\n",
    "    shortest_route = min(routes, key=lambda x: x['legs'][0]['distance']['value'])\n",
    "    return shortest_route\n",
    "\n",
    "# Function to generate Embed API URL for the entire route (multiple places)\n",
    "def generate_embed_url_for_route(api_key, places):\n",
    "    # Format the places in the format expected by Google Maps Embed API\n",
    "    waypoints = '|'.join(places[1:-1])  # Exclude the first and last places as origin and destination\n",
    "    origin = places[0]\n",
    "    destination = places[-1]\n",
    "    \n",
    "    # Return the complete Embed URL\n",
    "    embed_url = f\"https://www.google.com/maps/embed/v1/directions?key={api_key}&origin={origin}&destination={destination}&waypoints={waypoints}\"\n",
    "    return embed_url\n",
    "\n",
    "# Test the code in the notebook\n",
    "# api_key = \"AIzaSyAtYX5WZLCCZT7T-zh61LLZJwByaFphlak\"  # Replace with your actual API key\n",
    "places = [\"Pashupatinath\", \"Boudhanath\", \"Kopan Monastery\", \"Phulchowki\"]\n",
    "\n",
    "# Generate the Embed URL for the entire route\n",
    "embed_url_for_route = generate_embed_url_for_route(api_key, places)\n",
    "\n",
    "# Display the Embed URL for the entire route\n",
    "print(f\"Embed URL for entire route: {embed_url_for_route}\")\n"
